  return (
    <div className='home'>
      <div className='about'>
        <h2>Hi, my name is Oscar</h2>
        <div className="prompt">
          <p>A software developer with a passion for learning and creating.</p>
          <LinkedInIcon />
          <EmailIcon />
          <GithubIcon />
        </div>

      </div>
      <div className='skills'>

      </div>
    </div>
  )
}

export default Home
